INSERT INTO `v1_0ef841ecfd569ae7bdb9e024125a3f9b272e0c051ac1dd34438a9c87c6fdb162` VALUES (111011, 5, "", 1, 1110501049, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", 1, 0, 11, 0, 1110501);
INSERT INTO `v1_0ef841ecfd569ae7bdb9e024125a3f9b272e0c051ac1dd34438a9c87c6fdb162` VALUES (0, "", "", "", 1110501050, "", "", "", 91, "", 1110501);
